INSERT INTO `{key}payment` VALUES ('1', 'alipay', 'Alipay', '支付宝,阿里巴巴旗下提供的网上支付服务。', 'alipay_account,alipay_partner,alipay_security_code,alipay_seller_email,alipay_input_charset,alipay_transport,alipay_mainname,alipay_remark', '0', './Public/Uploads/Setting/4dca32ef65a60.gif'), ('2', 'paypal', 'Paypal', 'Paypal全球最大在线支付平台', 'paypal_account,paypal_remark', '2', './Public/Uploads/Setting/4dca3321439bb.gif'), ('3', 'gspay', 'Gspay', '环迅支付主要为国际贸易商的提供 在线国际信用卡支付收款和离岸帐户开设和第三方托收服务提供解决方案.', 'gspay_site_id', '100', './Public/Uploads/Setting/4dca382835317.gif'), ('4', 'payeasy3d', 'Payeasy 3D-Secure payment', '首信易支付自1999 年3月开始运行，是中国首家实现跨银行跨地域提供多种银行卡在线交易的网上支付服务平台，现支持全国范围23家银行及全球范围4种国际信用卡在线支付，拥有千余家大中型企事业单位、政府机关、社会团体组成的庞大客户群。', 'payeasy3d_id,payeasy3d_key', '1', './Public/Uploads/Setting/4dca384432a04.gif'), ('5', 'payeasyn3d', 'Payeasy', '首信易支付自1999 年3月开始运行，是中国首家实现跨银行跨地域提供多种银行卡在线交易的网上支付服务平台，现支持全国范围23家银行及全球范围4种国际信用卡在线支付，拥有千余家大中型企事业单位、政府机关、社会团体组成的庞大客户群。', 'payeasyn3d_id,payeasyn3d_key', '1', './Public/Uploads/Setting/4dca537f84c2a.gif'), ('6', 'bankofchina', 'Bank Of China', '中国银行股份有限公司，国有控股金融机构，业务范围涵盖商业银行、投资银行和保险领域，旗下有中银香港、中银国际、中银保险控股机构。', '', '0', './Public/Uploads/Setting/4dca3359aad48.gif'), ('7', 'westernunion', 'Western Union', 'ww qweqweqeqwe', '', '1', './Public/Uploads/Setting/4dca33af0c6e7.gif'), ('8', 'letterofcredit', 'Letter Of Credit', '信用证(Letter of Credit，L／C) ，是指开证银行应申请人的要求并按其指示向第三方开立的载有一定金额的，在一定的期限内凭符合规定的单据付款的书面保证文件。信用证是国际贸易中最主要、最常用的支付方式。', '', '0', './Public/Uploads/Setting/4dca368f166de.gif'), ('9', 'moneygram', 'Money Gram', '速汇金汇款是Money Gram公司推出的一种快捷，简单。可靠及方便的国际汇款方式，目前该公司在全球150个国家和地区拥有总数超过50,000个的代理网点。', '', '0', './Public/Uploads/Setting/4dca36ac184f9.gif'), ('10', 'ctopay', 'CtoPay', '收汇宝-收汇宝收汇宝是电信支付的重点产品，是由广东省电信实业集团深圳市有限公司全力打造的外汇收款工具', '', '0', './Public/Uploads/Setting/4dca36c3da6ab.gif'), ('11', 'ecpss', 'ECPSS', '上海汇阜信息技术有限公司, Shanghai  Ecpss Co. Limited(E-commerce Payment Service Solution) (简称：ECPSS) , 是专注于国际卡收单服务的第三方支付平台， 全力为国内外接受国际卡支付的商家提供世界一流的收单服务。', 'ecpss_md5key,ecpss_mer', '3', './Public/Uploads/Setting/4dca36f61cd0b.gif'), ('12', 'ips', 'IPS', '', 'ips_mer,ips_key,ips_rate', '0', './Public/Uploads/Setting/4dca371044c71.gif'), ('13', '_95epay', '95epay', '', '_95epay_key,_95epay_no', '0', './Public/Uploads/Setting/4dca37356c890.gif'), ('14', 'payments', 'Jump to the payment information page', '', 'payments_url', '0', './Public/Uploads/Setting/4dca37db69a8e.gif'), ('15', 'wedopay', 'Wedopay', 'wedopay', 'wedopay_md5key,wedopay_merno', '0', './Public/Uploads/Setting/4dca3806064a2.gif'), ('17', 'paypal_no_online', 'Paypal no-online Payment', '', '', '1000', './Public/Uploads/Setting/paypal_icon.gif');
